The '''1st Air Force Wing Reserve (1AFWR)''', formerly called the 1st Ready Reserve Air Wing (1RRAW) is a combat-support unit under the [[Philippine Air Force Reserve Command|Air Force Reserve Command (AFRC)]], [[Philippine Air Force]], and is based in [[Villamor Air Base|Colonel Jesus A. Villamor Air Base]] in [[Pasay City]], [[Metro Manila]], [[Philippines]]. Its headquarters offices are located at the AFRC building inside the air base. The wing covers all Air Force reserve units in the National Capital Region. 1st AFWR is divided into the 11th, 12th, and 13th Air Force Groups Reserve (AFGR). Currently, the 1st AFWR is under the command of Brig. Gen. Elihu A. Ybanez, AFP.
In Luzon, the other air force reserve wings are the 2nd AFWR based at Clark Air Base that covers the area from Central Luzon up to all of northern Luzon, and the 3rd AFWR at Fernando Air Base in Batangas that covers all of southern Luzon from Cavite towards the Bicol Region.
